import { ProductCategoryRow } from "./ProductCategoryRow";

export function ProductTable(props) {
    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Price ($)</th>
                    </tr>
                </thead>
                <tbody>
                    <ProductCategoryRow
                        onOnlyInStockChange={props.onOnlyInStockChange}
                        data={props.data} />
                </tbody>
            </table>
        </>
    )
}
